import React from 'react'

function Todolist(props) {
  return (
    <div className='text-center'>
<h3> Todolist</h3>
 { props.todos.map((task,index)=><h4 key={index} className='text-primary'> {task}</h4>) }
    </div>
  )
}

export default Todolist
